import { Outlet, Link } from "react-router-dom";



const Layout = () => {
  return (
    <>
    <div>
    <p>Cose</p>
    </div>
      <nav>
        <ul>
          <li>
            <Link to="/"><button>button</button></Link>
          </li>
          <li>
            <Link to="/blogs">Blogs</Link>
          </li>
          <li>
            <Link to="/contact">Contact</Link>
          </li>
        </ul>
      </nav>
    <Outlet />
    </>
    );
};

export default Layout;
